import React, { useState } from 'react';
import Tabs from "../tab-forms/tab";
import styled from "styled-components";
import OnDemand from "./on-demand/";
import Rental from "./rental/";
import OurStation from "./our-station/";
import Delivery from "./delivery/";

const ContainerWrapper = styled("div")`
position:absolute;
top:0px;
margin: 20px;
`;

const ChildrenContainer = styled("div")`

padding:5px 0px;
`;

const Tab = styled(Tabs)`
border-bottom: 5px solid #EFF2F5;

`;


const Container = () => {
    const [selectedContent, setSelectedContent] = useState("demand");
    return (
        <ContainerWrapper>
            <Tab
                setSelectedContent={setSelectedContent}
                contentView={<ChildrenContainer>
                    {
                        selectedContent == "rental" ?
                            <Rental /> :
                            selectedContent == "station" ?
                                <OurStation /> :
                                selectedContent == "delivery" ?
                                    <Delivery /> :
                                    <OnDemand />

                    }

                </ChildrenContainer>} />
        </ContainerWrapper>
    );
}

export default Container;
